import React from 'react'

const TodosList = ({todos, setTodos}) => {
  return (
    <div>
        {todos.map((todo) => (
            <li className='list-item' key={todo.id}>
                <input 
                  type="text" 
                  value = {todo.title} 
                  className= "list" 
                  onChange={(e) => e.preventDefault()} 
                />
                <div>
                <button className='button-complete task-button'></button>
                <button className='button-edit'>b</button>
                <button className='button-delete'>c</button>
                </div>
            </li>
        ))}
    </div>
  );
};

export default TodosList
